        new: true
    });

    res.status(200).json(upData);
}

const deleteLibro = async(req, res) => {
    let id = req.params.id;
    const deleteData = await LibrosShema.findByIdAndDelete(id);
    res.status(200).json(deleteData);
}



module.exports = {
    getLibros,
    getLibro,
    addLibro,
    editLibro,
    deleteLibro
}

